INSERT INTO `cropdata_blog` VALUES (7,'sumit','Data Mining in Agriculture','Every year, technology changes and new developments help many economic sectors discover new ways to improve, forecast a change, etc. For example, one economic sector that is benefitting from using new developments in technology is agriculture. In agriculture, a way to discover this type of changes is through data mining. But what exactly is data mining and how is agriculture benefitting from this. “Data mining involves the process of finding large quantity of previously unknown data, and then their use in important business decision making” (Milovic & Radojevic, 2015). For instance, in developing countries such as India, using data mining for “price prediction helps the farmers and also Government to make effective decision[s]” (Hemageetha & Nasira, 2012). Furthermore, data mining is something that could also help consumers by preparing them in case of any change in prices. Finally, this method of collecting data is something that can definitely improve and benefit the way farmers, government, and consumers make better decisions in the future with different applications, but it also has challenges and limitations.\r\nUsing data mining in agriculture benefits farmers, government, etc. in many ways. One of the ways that using data mining is beneficial in agriculture is “possibility to study hidden patterns in datasets in agricultural domain. These patterns can be used for diagnosing crop condition, prognosing market development, monitoring customer solvency” (Milovic & Radojevic, 2015). In other words, it can help farmers tell around the time that their crop would flourish, make predictions of when their product is more likely to sell, and what product customers are buying more. Also, another benefit is that “Agricultural institutions use data mining technique and applications for different areas, for instance agronomists use patterns measuring growth indicators of plants, crop quality indicators, success of taken agro technical measures and managers of agricultural organizations pay attention on user satisfaction and economically optimal decisions” (Milovic & Radojevic, 2015).\r\n\r\nData mining uses many applications to forecast several things that could happen with produce, crops, etc. For instance, farmers use K – means cluster algorithm in order to determine which apples could be sold for a lower price and which apples could be sold at a normal price based on how much damaged they have. Moreover, during k – means cluster, the apples are divided and based on those apples that are bad, they are divided again to make sure which ones go for sale and which ones don’t. Furthermore, in order to get which crops are used more and which ones are the closest to that crop in case that is missing, we use Support Vector Machine (SVM).\r\n\r\nEven though data mining has a lot of benefits through the usage of applications, there are still challenges and limitations that need improvement. For example, one of the challenges and limitations that data mining in agriculture has is “missing, invalid, inconsistent or nonstandard data like parts of information recorded in different formats from different data sources create a large obstacle for successful data mining” (Milovic & Radojevic, 2015). In other words, if you don’t have enough information or correct information, it could lead to results that may not be true and could potentially lead to an economic loss.\r\nThe usage of data mining in agriculture is an innovative way that has helped and benefitted many farmers, managers, etc., and even countries. Also, based on applications, farmers can discover what decisions to make in order to improve their crop, sales, and what is the closest crop they have if they run out of the one they want. Even though data mining has it challenges and limitations, I believe that in the future those challenges will be solved to better the usage of data mining in agriculture.\r\n\r\nSources:\r\nMilovic, B., & Radojevic, V. (2015). Application of Data Mining in Agriculture. Retrieved January 10, 2017, from http://www.agrojournal.org/21/01-03.pdf','2017-12-28 07:01:25'),(8,'sumit','Data Mining Methods','Data mining uses different methods for the purpose of acquiring necessary information. Different methods are used for different purposes, where every method has its advantages and drawbacks. Data mining tasks can be divided into descriptive and predictive. While descriptive tasks aim to find human interpreted patterns and associations, after considering data as well as the entire model construction, predicting tasks aim to predict some response of interest. Even though the goals of description and prediction may overlap, the main difference is that predictive tasks require a special variable of response. Response may be categorical or numerical, which further classifies data mining as classification and regression. Predictive tasks enable prediction of variable value based on other existing information. Descriptive tasks, on the other hand, unify data in a certain manner. Main predictive and descriptive tasks of data mining can be divided into (Weiss and Davison, 2010):\r\n\r\nClassification and regression :– identification of new patterns with previously defined goals; These tasks are predictive and involve the construction of models in the aim of predicting a goal, or dependent, variable from the set of explained, or independent variables. Classification is the process of finding the function for classifying data in one of several classes. For tasks of classification the goal variable usually has a small number of discrete values, while with tasks of regression the goal variable is continuous. \r\n\r\nAssociation rules :– analysis of rules of association is a descriptive data mining task which involves determining patterns, or associations, between the elements in the data set. Associations are presented in the form of rules, or implications. \r\n\r\nCluster analysis :– descriptive data mining task in which the goal is to group similar objects in the same cluster and different in different clusters. Process of grouping defines groups of similar data, but different than the rest of data. In this process variables by which the grouping is most efficient are often identified. K-means algorithm selects (k) number of objects randomly, where each object represents a cluster mean. Each object is assigned, based on the distance between the object and the cluster mean, to the cluster to which it is most similar. Then it computes new mean for each cluster. Algorithm repeats itself until it reaches its goal.\r\n\r\nText mining tasks :– most of available data is in the shape of unstructured or partially structured text, different from conventional data, which is completely structured. Text is unstructured if there is no previously defined format, or structure in the data. Text is partially structured if there is a structure connects to one part of data. While text mining tasks usually fall in the category of classification, clustering and association rule mining, it is best to regard them as separate, because unstructured text requires special consideration. Method for presenting textual data is especially critical.\r\n\r\nLink analysis :– form of network analysis examining associations between objects. Link classification predicts the category of an object, not just based on its characteristics, but also on the basis of existing connections, and the characteristics of objects connected by a certain path (Getoor, 2003). With the completion of information analysis, all results are presented in a clear manner, often in the form of charts or diagrams either two-dimensional or three-dimensional. Software even enables the user to change variables and view the effects in real time.\r\n\r\nSources : http://www.agrojournal.org/21/01-03.pdf','2017-12-28 06:14:39');
/*!40000 ALTER TABLE `cropdata_blog` ENABLE KEYS */;
UNLOCK TABLES;

